  "notes": "* <i>Distortion</i> will be buffered and cast as soon as the cooldown ends if the player attempts to cast it within 0.<small>5</small> seconds of the cooldown ending.\n<ul><li><ul><li>The <span class=\"template_sbc\"><b>recast</b></span> will be buffered and cast as soon as it becomes available if the player attempts to cast it within 0.<small>3</small> seconds of it becoming available to cast.</li></ul></li>\n<li>The initial cast counts as an ability activation for the purposes of on-cast effects such as <span class=\"glossary\" style=\"white-space:pre; position:relative;\" data-game=\"lol\" data-tip=\"Spellblade\"><a title=\"Named item effect\" href=\"/wiki/Named_item_effect#Spellblade\"><img data-image-name=\"Sheen item.png\" data-relevant=\"0\" alt=\"Sheen item\" decoding=\"async\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/c/c6/Sheen_item.png/revision/latest/scale-to-width-down/20?cb=20201118210052\" height=\"20\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" class=\"lazyload\" loading=\"lazy\" width=\"20\" data-image-key=\"Sheen_item.png\"></a> <a title=\"Named item effect\" href=\"/wiki/Named_item_effect#Spellblade\">Spellblade</a></span> and triggering <span data-param=\"\" style=\"display:inline;white-space:pre;\" class=\"inline-image label-after ability-icon\" data-game=\"lol\" data-ability=\"Force Pulse\" data-champion=\"Kassadin\"><span data-width=\"20\" class=\"border\" style=\"display:inline-block;position:relative;\"><a title=\"Force Pulse's\" href=\"/wiki/Kassadin/LoL#Force_Pulse\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/2/22/Kassadin_Force_Pulse.png/revision/latest/scale-to-width-down/20?cb=20170818190412\" data-image-key=\"Kassadin_Force_Pulse.png\" alt=\"Force Pulse's\" data-image-name=\"Kassadin Force Pulse.png\" class=\"thumbborder lazyload\" width=\"20\" loading=\"lazy\" decoding=\"async\" height=\"20\" data-relevant=\"0\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/Kassadin/LoL#Force_Pulse\" title=\"Kassadin/LoL\">Force Pulse's</a></span></span> passive.\n<ul><li>Recasting the ability does not.</li>\n<li><span class=\"inline-image label-after ability-icon\" style=\"display:inline;white-space:pre;\" data-ability=\"Mimic: Distortion\" data-game=\"lol\" data-param=\"\" data-champion=\"LeBlanc\"><span data-width=\"20\" class=\"border\" style=\"display:inline-block;position:relative;\"><a title=\"Mimic: Distortion\" href=\"/wiki/LeBlanc/LoL#Mimic:_Distortion\"><img data-relevant=\"0\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" class=\"thumbborder lazyload\" data-image-name=\"LeBlanc Mimic- Distortion.png\" data-image-key=\"LeBlanc_Mimic-_Distortion.png\" alt=\"Mimic: Distortion\" loading=\"lazy\" decoding=\"async\" height=\"20\" width=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/92/LeBlanc_Mimic-_Distortion.png/revision/latest/scale-to-width-down/20?cb=20161018212244\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/LeBlanc/LoL#Mimic:_Distortion\" title=\"LeBlanc/LoL\">Mimic: Distortion</a></span></span> has the same properties.</li></ul></li>\n<li><i>Distortion</i> and <span class=\"inline-image label-after ability-icon\" data-champion=\"LeBlanc\" data-ability=\"Mimic: Distortion\" data-param=\"\" data-game=\"lol\" style=\"display:inline;white-space:pre;\"><span style=\"display:inline-block;position:relative;\" data-width=\"20\" class=\"border\"><a href=\"/wiki/LeBlanc/LoL#Mimic:_Distortion\" title=\"Mimic: Distortion\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\" decoding=\"async\" class=\"thumbborder lazyload\" data-relevant=\"0\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/92/LeBlanc_Mimic-_Distortion.png/revision/latest/scale-to-width-down/20?cb=20161018212244\" data-image-key=\"LeBlanc_Mimic-_Distortion.png\" loading=\"lazy\" data-image-name=\"LeBlanc Mimic- Distortion.png\" height=\"20\" alt=\"Mimic: Distortion\"></a></span> <span style=\"white-space:normal;\"><a title=\"LeBlanc/LoL\" href=\"/wiki/LeBlanc/LoL#Mimic:_Distortion\">Mimic: Distortion</a></span></span> have independent return pads and <b>LeBlanc</b> can travel to both while they are active.</li>\n<li><i>Distortion's</i> pad duration starts once the dash ends.</li></ul>",
