  "notes": "* Both the initial and the delayed damage can detonate <span data-game=\"lol\" data-champion=\"LeBlanc\" data-param=\"\" class=\"inline-image label-after ability-icon\" style=\"display:inline;white-space:pre;\" data-ability=\"Sigil of Malice\"><span style=\"display:inline-block;position:relative;\" data-width=\"20\" class=\"border\"><a href=\"/wiki/LeBlanc/LoL#Sigil_of_Malice\" title=\"Sigil of Malice\"><img width=\"20\" data-relevant=\"0\" loading=\"lazy\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" alt=\"Sigil of Malice\" data-image-name=\"LeBlanc Sigil of Malice.png\" data-image-key=\"LeBlanc_Sigil_of_Malice.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/93/LeBlanc_Sigil_of_Malice.png/revision/latest/scale-to-width-down/20?cb=20180415162326\" decoding=\"async\" class=\"thumbborder lazyload\" height=\"20\"></a></span> <span style=\"white-space:normal;\"><a href=\"/wiki/LeBlanc/LoL#Sigil_of_Malice\" title=\"LeBlanc/LoL\">Sigil of Malice</a></span></span>.\n<ul><li><i>Ethereal Chains</i> and <span data-game=\"lol\" data-ability=\"Mimic: Ethereal Chains\" class=\"inline-image label-after ability-icon\" data-param=\"\" data-champion=\"LeBlanc\" style=\"display:inline;white-space:pre;\"><span class=\"border\" data-width=\"20\" style=\"display:inline-block;position:relative;\"><a href=\"/wiki/LeBlanc/LoL#Mimic:_Ethereal_Chains\" title=\"Mimic: Ethereal Chains\"><img height=\"20\" alt=\"Mimic: Ethereal Chains\" class=\"thumbborder lazyload\" data-image-name=\"LeBlanc Mimic- Ethereal Chains.png\" width=\"20\" data-image-key=\"LeBlanc_Mimic-_Ethereal_Chains.png\" data-relevant=\"0\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/99/LeBlanc_Mimic-_Ethereal_Chains.png/revision/latest/scale-to-width-down/20?cb=20161018211933\" loading=\"lazy\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" decoding=\"async\"></a></span> <span style=\"white-space:normal;\"><a title=\"LeBlanc/LoL\" href=\"/wiki/LeBlanc/LoL#Mimic:_Ethereal_Chains\">Mimic: Ethereal Chains</a></span></span> are separate debuffs, and can both be tethered to the same target without overriding each other. The <span data-game=\"lol\" style=\"white-space:pre; position:relative;\" data-tip=\"Root\" class=\"glossary\"><a title=\"Root\" href=\"/wiki/Root\"><img data-image-key=\"Root_icon.png\" alt=\"Root icon\" data-image-name=\"Root icon.png\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-relevant=\"0\" width=\"20\" height=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/6/6b/Root_icon.png/revision/latest/scale-to-width-down/20?cb=20171201224302\" class=\"lazyload\" loading=\"lazy\" decoding=\"async\"></a> <a title=\"Root\" href=\"/wiki/Root\" class=\"mw-redirect\">root</a></span> duration for either one are unchanged.</li>\n<li><span class=\"glossary\" style=\"white-space:pre; position:relative;\" data-game=\"lol\" data-tip=\"Spell shield\"><a title=\"Spell shield\" href=\"/wiki/Spell_shield\"><img decoding=\"async\" data-image-key=\"Sivir_Spell_Shield.png\" data-relevant=\"0\" loading=\"lazy\" width=\"20\" data-image-name=\"Sivir Spell Shield.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/a/a0/Sivir_Spell_Shield.png/revision/latest/scale-to-width-down/20?cb=20170818194532\" class=\"lazyload\" alt=\"Spell Shield\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" height=\"20\"></a> <a title=\"Spell shield\" href=\"/wiki/Spell_shield\">Spell shield</a></span> will block the tether's application and initial damage but not the aftereffects of one already applied.</li>\n<li>The tether remains for a minimum of 0.<small>25</small> seconds regardless of distance.</li>\n<li>This ability will cast from wherever the caster is at the end of the cast time.</li></ul>",
